import React from 'react';

const FlagGl = props => (
  <svg viewBox="0 0 18 12" {...props}>
    <path fill="#fff" d="M0 0h18v12H0z" />
    <path fill="#d00c33" d="M0 6h18v6H0zm3 0a4 4 0 0 0 8 0 4 4 0 0 0-8 0" />
  </svg>
);

export default FlagGl;
